import React from 'react';

function AIInsights({ insights, customer }) {
  if (!insights) {
    return (
      <div className="panel ai-insights-panel">
        <h3>ü§ñ AI Insights</h3>
        <p className="no-data">AI analysis will appear here during the call...</p>
      </div>
    );
  }

  return (
    <div className="panel ai-insights-panel">
      <h3>ü§ñ AI Insights</h3>

      {/* Customer Relationship Insights */}
      {customer && (
        <div className="customer-insights-box">
          <h4>üë§ Customer Insights</h4>
          <div className="customer-insight-item">
            <span className="insight-icon">üéâ</span>
            <span>Loyal customer for <strong>{customer.tenure_months || 0} months</strong> ({Math.floor(customer.tenure_months / 12)}+ years)</span>
          </div>
          {customer.payment_history && customer.payment_history.missed_payments === 0 && (
            <div className="customer-insight-item">
              <span className="insight-icon">‚úÖ</span>
              <span><strong>Perfect payment history</strong> - Never missed a payment!</span>
            </div>
          )}
          {customer.payment_history && customer.payment_history.on_time_percentage === 100 && (
            <div className="customer-insight-item recommendation">
              <span className="insight-icon">üí°</span>
              <span>Suggest: "I see you've been with us for {Math.floor(customer.tenure_months / 12)} years and never missed a payment - we really appreciate customers like you!"</span>
            </div>
          )}
          {customer.plan && customer.plan.monthly_cost > 95 && (
            <div className="customer-insight-item">
              <span className="insight-icon">‚≠ê</span>
              <span>Premium customer (${customer.plan.monthly_cost}/mo)</span>
            </div>
          )}
          {customer.lifetime_value && customer.lifetime_value > 3000 && (
            <div className="customer-insight-item">
              <span className="insight-icon">üíé</span>
              <span>High-value customer (${customer.lifetime_value.toFixed(2)} LTV)</span>
            </div>
          )}
          {customer.autopay && (
            <div className="customer-insight-item">
              <span className="insight-icon">üîÑ</span>
              <span>Auto-pay enabled - Reliable customer</span>
            </div>
          )}
        </div>
      )}

      <div className="insights-grid">
        <div className="insight-card">
          <div className="insight-label">Issue Category</div>
          <div className="insight-value category">{insights.issue_category}</div>
        </div>
        <div className="insight-card">
          <div className="insight-label">Sentiment</div>
          <div className={`insight-value sentiment ${insights.sentiment.toLowerCase()}`}>
            {insights.sentiment}
          </div>
        </div>
        <div className="insight-card">
          <div className="insight-label">Urgency</div>
          <div className={`insight-value urgency ${insights.urgency_level.toLowerCase()}`}>
            {insights.urgency_level}
          </div>
        </div>
        <div className="insight-card">
          <div className="insight-label">Confidence</div>
          <div className="insight-value">{Math.round(insights.confidence * 100)}%</div>
        </div>
      </div>

      {insights.key_facts && insights.key_facts.length > 0 && (
        <div className="key-facts">
          <h4>Key Facts</h4>
          <ul>
            {insights.key_facts.map((fact, idx) => (
              <li key={idx}>{fact}</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default AIInsights;
